import React, { useState } from "react";
import "./Container.css";

function Container() {
  const [checked, setChecked] = useState(false);
  const [checked2, setChecked2] = useState(false);

  const toggleOne = () => {
      setChecked(prev => !prev)
  }






  return (
    <div className="container">
      <header className="header">
        <div className="rectangle rectangle--main">
          <button>Odwróć</button>
          <button>Wielkie litery</button>
        </div>
        <div className="rectangle">
          <div className="wrapper">
            <input onChange={() => toggleOne()} checked={checked ? false : true} type="radio" />
            <input type="text" />
          </div>
        </div>
        <div className="rectangle">
          <div className="wrapper">
            <input checked={checked2} type="radio" />
            <input type="text" />
          </div>
        </div>
      </header>
    </div>
  );
}

export default Container;
